    totaling $1947.50 have been removed from this amended report filed on 7/20/07
    and attributed to the correct corresponding report.  2.  The 19, 191.48 memo activity
    has been correctly linked to their corresponding payments.  3.  The H2 report
    now reflects ratios for JJ2007/06/09 and Q2Fundraising.  4.  The event activity
    calculations have been amended to correctly reflect the ytd totals.    If you
    have any further questions, please contact Anne Morgan at 850-222-3411.    In
    addtion, please be advised that no employee spent more than 25% of his/her time
    on Federal election activity (FEA) or on activities in connection with a Federal
    election.  Therefore, the payments listed above as well as any payments for benefits
    were properly paid on the Administrative split.   The payments for Consulting/Compliance
    & Consulting/Fundraising were not made on behalf of a federal candidate nor in
    connection with federal election activity."
